function sum(a,b){
    return `sum of two number is  ${a+b}` ;
}
function Sub(a,b){
    return `Sub of two number is  ${a+b}` ;
}
function Div(a,b){
    return `Div of two number is  ${a/b}` ;
}
function Mult(a,b){
    return `Mult of two number is  ${a*b}` ;
}

export default sum;
export {Sub,Div,Mult};
